import nanogptjs from 'nanogptjs'
import { json } from '@sveltejs/kit'
import {
    MODEL_TYPE_IMAGE,
    DELIMITER
} from '$lib/common'
import { envToBool } from '$lib/utils'
import { DEV_MODE } from '$lib/env.js'

// -----

export async function POST({ request }) {

    let { apiKey, prompt, models, modelType } = await request.json()
    
    const nanogpt = nanogptjs({ apiKey })

    let replies = await Promise.all(models.map(async function (model) {
        let error = false

        if (!model) {
            return {
                reply: '',
                nanoCost: 0
            }
        }

        // if image generation request
        if (modelType === MODEL_TYPE_IMAGE) {

            let width = Number(model.split(DELIMITER)[2].split('x')[0])
            let height = Number(model.split(DELIMITER)[2].split('x')[1])

            try{
                if (envToBool(DEV_MODE)) {
                    // randomly fail
                    if (Math.floor(Math.random() * 10) === 5) {
                        throw new Error('random fail test')
                    }
                    var { base64 , metadata: { cost: nanoCost } } = { base64: EXAMPLE_BASE64, metadata: { cost: 0.0001 } }    
                } else {
                    let response = await nanogpt.image({
                        prompt,
                        model: model.split(DELIMITER)[0],
                        width,
                        height
                    })

                    var { base64 , metadata: { cost: nanoCost } } = response                
                }
            } catch(e) {
                error = e.message
            }

            reply = base64
        } else { // chat request
            try{
                if (envToBool(DEV_MODE)) {
                    // randomly fail
                    if (Math.floor(Math.random() * 10) === 5) {
                        throw new Error('random fail test')
                    }                    
                   var { reply , metadata: { cost: nanoCost } } = { reply: 'hello' + Math.random(), metadata: { cost: 0.0001 } }    
                } else {
                    let response = await nanogpt.chat({
                        prompt,
                        model: model.split(DELIMITER)[0]
                    })                    

                    var { reply , metadata: { cost: nanoCost } } = response
                }
            } catch(e) {
                error = e.message
            }                
        }

        return Object.assign(
            {
                reply,
                nanoCost,
                model,
                error
            },
            { modelSnapshot: model }
        )
    }))

    return json({
        replies
    })

   

}

// ---------------------------------------------------

const EXAMPLE_BASE64 = ''